import React from "react";

function Cart(props) {
  return (
    <div className="cart">
      <h2>Cart</h2>
      <ul>
        {props.cartItems.map((item) => (
          <div key={item.id}>
            {item.title}
            <img src={item.image} alt={`${item.title}`} />
            {item.price}
            <button>placeholder</button>
          </div>
        ))}
      </ul>
    </div>
  );
}

export default Cart;
